import React, { useEffect, useState } from "react";
import axios from "axios";

const Loginp = () => {
  const [activeSection, setActiveSection] = useState("content");
  const [doctors, setDoctors] = useState([]);
  const [notApprovedDoctors, setNotApprovedDoctors] = useState([]);
  const [docId, setDocId] = useState(0);
  const [docName, setDocName] = useState("");
  const [docEmail, setDocEmail] = useState("");
  const [docPassword, setDocPassword] = useState("");
  const [speciality, setSpeciality] = useState("");
  const [docAge, setDocAge] = useState(0);
  const [docGender, setDocGender] = useState("");
  const [docDescription, setDocDescription] = useState("");
  const [experience, setExperience] = useState(0);
  const [docPhoneNumber, setDocPhoneNumber] = useState(0);
  const [docImg, setDocImg] = useState("");
  const [status, setStatus] = useState("");

  useEffect(() => {
    fetchApprovedDoctors();
    fetchNotApprovedDoctors();
  }, []);
  

  const fetchApprovedDoctors = () => {
    axios
      .get("", {
        headers: {
          Authorization: "Bearer " + localStorage.getItem("token"),
        },
      })
      .then((response) => setDoctors(response.data))
      .catch((error) => console.log(error));
  };

  const fetchNotApprovedDoctors = () => {
    axios
      .get("", {
        headers: {
          Authorization: "Bearer " + localStorage.getItem("token"),
        },
      })
      .then((response) => setNotApprovedDoctors(response.data))
      .catch((error) => console.log(error));
  };

  const handleSectionClick = (section) => {
    setActiveSection(section);
  };

  const handledocIdInputChange = (event) => {
    setDocId(event.target.value);
  };

  const handledocNameInputChange = (event) => {
    setDocName(event.target.value);
  };

  const handledocEmailInputChange = (event) => {
    setDocEmail(event.target.value);
  };

  const handledocPasswordInputChange = (event) => {
    setDocPassword(event.target.value);
  };

  const handlespecialityInputChange = (event) => {
    setSpeciality(event.target.value);
  };

  const handledocAgeInputChange = (event) => {
    setDocAge(event.target.value);
  };

  const handledocGenderInputChange = (event) => {
    setDocGender(event.target.value);
  };

  const handledocDescriptionInputChange = (event) => {
    setDocDescription(event.target.value);
  };

  const handleExperienceInputChange = (event) => {
    setExperience(event.target.value);
  };

  const handledocPhoneNumberInputChange = (event) => {
    setDocPhoneNumber(event.target.value);
  };

  const handledocImgInputChange = (event) => {
    setDocImg(event.target.value);
  };

  const handleStatusInputChange = (event) => {
    setStatus(event.target.value);
  };

  const handleAddDoctorSubmit = (event) => {
    event.preventDefault();
    const newDoctor = {
      id: docId,
      name: docName,
      email: docEmail,
      password: docPassword,
      speciality: speciality,
      age: docAge,
      gender: docGender,
      description: docDescription,
      experience: experience,
      phoneNumber: docPhoneNumber,
      img: docImg,
    };

    axios
      .post("https://api.example.com/doctors", newDoctor, {
        headers: {
          Authorization: "Bearer " + localStorage.getItem("token"),
        },
      })
      .then((response) => {
        console.log(response.data);
        setDoctors([...doctors, response.data]);
        resetAddDoctorForm();
      })
      .catch((error) => console.log(error));
  };

  const resetAddDoctorForm = () => {
    setDocId(0);
    setDocName("");
    setDocEmail("");
    setDocPassword("");
    setSpeciality("");
    setDocAge(0);
    setDocGender("");
    setDocDescription("");
    setExperience(0);
    setDocPhoneNumber(0);
    setDocImg("");
  };

  const handleApproveDoctor = (doctorId) => {
    axios
      .put(
        `https://api.example.com/doctors/${doctorId}/approve`,
        {},
        {
          headers: {
            Authorization: "Bearer " + localStorage.getItem("token"),
          },
        }
      )
      .then((response) => {
        console.log(response.data);
        fetchNotApprovedDoctors();
        fetchApprovedDoctors();
      })
      .catch((error) => console.log(error));
  };

  const handleDeleteDoctor = (doctorId) => {
    axios
      .delete(`https://api.example.com/doctors/${doctorId}`, {
        headers: {
          Authorization: "Bearer " + localStorage.getItem("token"),
        },
      })
      .then((response) => {
        console.log(response.data);
        fetchApprovedDoctors();
      })
      .catch((error) => console.log(error));
  };

  return (
    <div>
      <h1>Admin Panel</h1>
      <div>
        <button
          onClick={() => handleSectionClick("content")}
          className={activeSection === "content" ? "active" : ""}
        >
          Content
        </button>
        <button
          onClick={() => handleSectionClick("addDoctor")}
          className={activeSection === "addDoctor" ? "active" : ""}
        >
          Add Doctor
        </button>
        <button
          onClick={() => handleSectionClick("notApprovedDoctors")}
          className={activeSection === "notApprovedDoctors" ? "active" : ""}
        >
          Not Approved Doctors
        </button>
      </div>

      {activeSection === "content" && (
        <div>
          <h2>Approved Doctors</h2>
          {doctors.map((doctor) => (
            <div key={doctor.id}>
              <h3>{doctor.name}</h3>
              <p>Email: {doctor.email}</p>
              <p>Speciality: {doctor.speciality}</p>
              <p>Age: {doctor.age}</p>
              <p>Gender: {doctor.gender}</p>
              <p>Description: {doctor.description}</p>
              <p>Experience: {doctor.experience} years</p>
              <p>Phone Number: {doctor.phoneNumber}</p>
              <img src={doctor.img} alt={doctor.name} />
              <button onClick={() => handleDeleteDoctor(doctor.id)}>
                Delete
              </button>
            </div>
          ))}
        </div>
      )}

      {activeSection === "addDoctor" && (
        <div>
          <h2>Add Doctor</h2>
          <form onSubmit={handleAddDoctorSubmit}>
            <div>
              <label htmlFor="docId">ID:</label>
              <input
                type="text"
                id="docId"
                value={docId}
                onChange={handledocIdInputChange}
              />
            </div>
            <div>
              <label htmlFor="docName">Name:</label>
              <input
                type="text"
                id="docName"
                value={docName}
                onChange={handledocNameInputChange}
              />
            </div>
            <div>
              <label htmlFor="docEmail">Email:</label>
              <input
                type="email"
                id="docEmail"
                value={docEmail}
                onChange={handledocEmailInputChange}
              />
            </div>
            <div>
              <label htmlFor="docPassword">Password:</label>
              <input
                type="password"
                id="docPassword"
                value={docPassword}
                onChange={handledocPasswordInputChange}
              />
            </div>
            <div>
              <label htmlFor="speciality">Speciality:</label>
              <input
                type="text"
                id="speciality"
                value={speciality}
                onChange={handlespecialityInputChange}
              />
            </div>
            <div>
              <label htmlFor="docAge">Age:</label>
              <input
                type="number"
                id="docAge"
                value={docAge}
                onChange={handledocAgeInputChange}
              />
            </div>
            <div>
              <label htmlFor="docGender">Gender:</label>
              <input
                type="text"
                id="docGender"
                value={docGender}
                onChange={handledocGenderInputChange}
              />
            </div>
            <div>
              <label htmlFor="docDescription">Description:</label>
              <textarea
                id="docDescription"
                value={docDescription}
                onChange={handledocDescriptionInputChange}
              />
            </div>
            <div>
              <label htmlFor="experience">Experience (years):</label>
              <input
                type="number"
                id="experience"
                value={experience}
                onChange={handleExperienceInputChange}
              />
            </div>
            <div>
              <label htmlFor="docPhoneNumber">Phone Number:</label>
              <input
                type="tel"
                id="docPhoneNumber"
                value={docPhoneNumber}
                onChange={handledocPhoneNumberInputChange}
              />
            </div>
            <div>
              <label htmlFor="docImg">Image URL:</label>
              <input
                type="text"
                id="docImg"
                value={docImg}
                onChange={handledocImgInputChange}
              />
            </div>
            <button type="submit">Add</button>
          </form>
        </div>
      )}

      {activeSection === "notApprovedDoctors" && (
        <div>
          <h2>Not Approved Doctors</h2>
          {notApprovedDoctors.map((doctor) => (
            <div key={doctor.id}>
              <h3>{doctor.name}</h3>
              <p>Email: {doctor.email}</p>
              <p>Speciality: {doctor.speciality}</p>
              <p>Age: {doctor.age}</p>
              <p>Gender: {doctor.gender}</p>
              <p>Description: {doctor.description}</p>
              <p>Experience: {doctor.experience} years</p>
              <p>Phone Number: {doctor.phoneNumber}</p>
              <img src={doctor.img} alt={doctor.name} />
              <button onClick={() => handleApproveDoctor(doctor.id)}>
                Approve
              </button>
              <button onClick={() => handleDeleteDoctor(doctor.id)}>
                Delete
              </button>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default Loginp;
